  [],\n\t\"revision_timestamp\": \"2015-09-26T21:47:03.071110\",\n\t\"name\": \"2000-puget-sound-lidar-consortium-pslc-topographic-lidar-kitsap-peninsula-washington\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"TerraPoint surveyed and created this data
  for the Puget Sound LiDAR Consortium under contract. The area surveyed is approximately
  1,146 square miles and covers part of Kitsap Peninsula, the Seattle area north to
  the King-Snohomish county border and east to Snoqualmie. The data is broken down
  into USGS quarter quads and then into 25 tiles within each quarter quad. All data
  was collected during ideal conditions (leaf-off). The LAS files were derived from
  all returns ASCII files contain the X,Y,Z values of all the LiDAR returns collected
  during the survey mission. The standard GPS time, scan angle, intensity and return
  numbers of each point were preserved in the conversion from ASCII to LAS. The LAS
  files are unclassified. Futher details are available in the Process Steps below.
  This dataset was flown in 2000 with a 50% overlap between flight lines. Due to the
  overlap the nominal point spacing of the dataset is 1.0 meter. Several small areas
  in this project were reflown in 2002.\",\n\t\"license_title\": null,\n\t\"extras\":
